import React, { useState, useEffect } from 'react';
import axios from 'axios';

function JournalPage() {
    const [journals, setJournals] = useState([]);
    const [formData, setFormData] = useState({
        date: '',
        account: '',
        debit: '',
        credit: '',
    });
    const [showForm, setShowForm] = useState(false);

    useEffect(() => {
        fetchJournals();
    }, []);

    const fetchJournals = async () => {
        try {
            const response = await axios.get('http://localhost:7000/api/accounts');
            console.log(response);
            setJournals(response.data);
        } catch (error) {
            console.error('Error fetching journals:', error);
        }
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('https://api.example.com/journals', formData);
            setJournals([...journals, response.data]);
            setFormData({ date: '', account: '', debit: '', credit: '' });
            setShowForm(false);
        } catch (error) {
            console.error('Error adding journal:', error);
        }
    };

    return (
        <div>
            <div className="d-flex justify-content-between align-items-center mb-4">
                <h2>Data Jurnal Umum</h2>
                <button
                    className="btn btn-primary"
                    onClick={() => setShowForm(!showForm)}
                >
                    {showForm ? 'Tutup Form' : 'Tambah Jurnal'}
                </button>
            </div>

            {showForm && (
                <div className="card mb-4">
                    <div className="card-header">Input Jurnal Umum</div>
                    <div className="card-body">
                        <form onSubmit={handleSubmit}>
                            <div className="mb-3">
                                <label className="form-label">Tanggal</label>
                                <input
                                    type="date"
                                    className="form-control"
                                    name="date"
                                    value={formData.date}
                                    onChange={handleInputChange}
                                    required
                                />
                            </div>
                            <div className="mb-3">
                                <label className="form-label">Akun</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    name="account"
                                    value={formData.account}
                                    onChange={handleInputChange}
                                    required
                                />
                            </div>
                            <div className="mb-3">
                                <label className="form-label">Debit</label>
                                <input
                                    type="number"
                                    className="form-control"
                                    name="debit"
                                    value={formData.debit}
                                    onChange={handleInputChange}
                                    required
                                />
                            </div>
                            <div className="mb-3">
                                <label className="form-label">Kredit</label>
                                <input
                                    type="number"
                                    className="form-control"
                                    name="credit"
                                    value={formData.credit}
                                    onChange={handleInputChange}
                                    required
                                />
                            </div>
                            <button type="submit" className="btn btn-success">
                                Simpan
                            </button>
                        </form>
                    </div>
                </div>
            )}

            <div className="card">
                <div className="card-header">Data Jurnal Umum</div>
                <div className="card-body">
                    <table className="table table-striped">
                        <thead>
                            <tr>
                                <th>Akun</th>
                                <th>Nama</th>
                                <th>Type</th>
                            </tr>
                        </thead>
                        <tbody>
                            {journals.map((journal) => (
                                <tr key={journal.id}>
                                    <td>{journal.code}</td>
                                    <td>{journal.name}</td>
                                    <td>{journal.type}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    );
}

export default JournalPage;
